script: |
  super -f text -I q1634.spq | sort > q1634.out

inputs:
  - name: q1634.spq
    data: |
      SELECT DISTINCT - cor1.col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q1634.out
    data: |
      -10
      -13
      -26
